uploadtext:
Бу форманы кулланып серверга файлларны төйи аласыз. 
Элегрәк төялгән файлларны карау өчен [[Special:FileList|төялгән файллар исемлегенә]] мәрәҗәгать итегез. Шулай ук ул [[Special:Log/upload|төяүләр исемлегенә]] һәм [[Special:Log/delete|бетерелгән файллар]] исемлегенә дә языла.

Файлны мәкаләгә төяү өчен Сез менә бу үрнәкләрне куллана аласыз:
* <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:Файл.jpg]]</nowiki></code></strong> — файлның тулы юрамасын кую өчен;
* <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:Файл.png|200px|thumb|left|тасвирламасы]]</nowiki></code></strong> — 200 пиксельга кадәр киңлектәге һәм текстның сул ягында, тасвирламасы белән;
* <strong><code><nowiki>[[</nowiki>{{ns:media}}<nowiki>:Файл.ogg]]</nowiki></code></strong> — биттә файлны сурәтләмичә, бары тик сылтамасын гына кую.
